title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o8341.m15 -> o8279.m14 -> o8341.m3 -> o8279.m14
  o8279.m28 -> o8341.m3 -> o8279.m14 -> o8341.m3
  o8279.m16 -> o8341.m3 -> o8279.m14 -> o8341.m3
  o8341.m3 -> o8279.m14 -> o8341.m3
  o8279.m14 -> o8341.m3 -> o8279.m14

features:
  - inheritance
  - overriding
  - method
  - polymorphism

